import React from "react";
import styles from "./Users.module.css";

const UsersList = (props) => {
  return;
  <card>
    <ul>
      {props.users.map((user) => (
        <li>
          {" "}
          {user.name} ({user.age})
        </li>
      ))}
    </ul>
  </card>;
};

export default UsersList;
